import React from 'react'
import { MdOutlineLanguage } from "react-icons/md";
function Navbar() {
    const navitems=[
        {link:'Home',path:'home'},
        {link:'About',path:'about'},
        {link:'Menu',path:'menu'},
    ]

   
  return (
   <nav >
    <div className='text-xl'>
        <div>
            <a href="/"className=' font-semibold text-2xl flex item-center space-x-3' ></a>
        </div>
   
<ul className='md:flex space-x-12'>
    {
        navitems.map(({link,path})=>(
            <a key={link}  href={path} className=' block hover:text-gray-300'>{link}</a>
        ))
    }
    
</ul>
    </div>
    <div className='space-x-12 hidden md:flex items-center'>
    <a href="/" className='hidden lg:flex items-cente hover:text-purple-700'><MdOutlineLanguage  className='mr-2'/>Language</a>
    <button className='bg-purple-100 hover:bg-purple-700 transition-all duration-300 rounded py-1 px-1 text-purple-600 hover:text-white'>Sign up</button>
   
    </div>
    </nav>
  )
}

export default Navbar
